import { Component, Renderer2, ElementRef } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'frontend';
  showSpinner = false;

  constructor(private renderer: Renderer2, private el: ElementRef) {}

  // Função para mostrar o spinner
  showSpinnerOverlay() {
    this.showSpinner = true;
  }

  // Função para ocultar o spinner
  hideSpinnerOverlay() {
    this.showSpinner = false;
  }

  // Função para fechar a barra de navegação
  closeNavbar() {
    const navbarCollapse = this.el.nativeElement.querySelector('#navbarCollapse');
    this.renderer.removeClass(navbarCollapse, 'show');
  }

  // Método que será chamado ao clicar em um link da navegação
  onNavLinkClick() {
    this.closeNavbar();
    // Exemplo: Mostrar o spinner por 2 segundos e depois ocultá-lo
    this.showSpinnerOverlay();
    setTimeout(() => {
      this.hideSpinnerOverlay();
    }, 2000);
  }
}
